import React from 'react';
import { View } from 'react-native';
import { Icon, ButtonGroup } from 'react-native-elements';

const FooterScreen = () => {
  return (
    <View style={{ flexDirection: 'row', backgroundColor: '#0b81fe', paddingVertical: 8 }}>
      <ButtonGroup
        containerStyle={{ flex: 1 }}
        buttons={[
          { element: () => <Icon name="home" type="font-awesome" color="white" />, title: 'Home' },
          { element: () => <Icon name="comments" type="font-awesome" color="white" />, title: 'Chat' },
          { element: () => <Icon name="user" type="font-awesome" color="white" />, title: 'Profile' },
        ]}
      />
    </View>
  );
};

export default FooterScreen;
